import React, { useState, useEffect } from 'react';
import { tokenAPI } from '../services/apikiApi';

const homePage = () => {
  const [Post, setPost] = useState([]);
  useEffect(() => {
    tokenAPI().then((resp) => {
      setPost(resp);
    });
  }, []);
  return (
    <section>
      {Post.map((Post) => (
        <div>{Post.id}</div>
      ))}
    </section>
  );
};

export default homePage;
